{
  "version": "0.2",
  "phases": {
    "build": {
      "commands": [
        "env",
        "cd infra",
        "n stable",
        "npm ci",
        "npm run build",
        "npx cdk synth"
      ]
    }
  },
  "artifacts": {
    "base-directory": "infra/cdk.out",
    "files": "**/*"
  }
}

{
  "version": "0.2",
  "phases": {
    "pre_build": {
      "commands": [
        "env",
        "aws ecr get-login-password --region ap-southeast-2 | docker login --username AWS --password-stdin $ECR_REPO_URI",
        "cd server"
      ]
    },
    "build": {
      "commands": [
        "docker build -t $ECR_REPO_URI:$CODEBUILD_RESOLVED_SOURCE_VERSION -t $ECR_REPO_URI:latest ."
      ],
      "finally": [
        "printf '[{\"name\":\"server\",\"imageUri\":\"%s\"}]' $ECR_REPO_URI:$TAG > imagedefinitions.json",
        "cat imagedefinitions.json"
      ]
    },
    "post_build": {
      "commands": [
        "docker push $ECR_REPO_URI:$CODEBUILD_RESOLVED_SOURCE_VERSION",
        "docker push $ECR_REPO_URI:latest"
      ]
    }
  },
  "artifacts": {
    "files": [
      "imagedefinitions.json"
    ]
  }
}

